import React from 'react';

import {View, Image} from 'react-native';

const ActionBarLogOut = () => {
    return (
        <View style={{flexDirection: 'row'}}>
            <Image
                source={require('../assets/icons/logout.png')}
                style={{
                    width: 0,
                    height: 30,
                    // borderRadius: 40 / 2,
                    marginRight: 15,
                    // resizeMode : "contain"

                }}
            />
        </View>
    );
};

export default ActionBarLogOut;
